import React, { Component }  from 'react';
import CarouselPage from './CarouselPage';
import FeaturedToday from './FeaturedToday';
import BrowsePage from './BrowsePage';

class Home extends Component {
  constructor(props) {
    super(props);
  }
  render() {
    return (
      <div className="mt-1">
        <CarouselPage />
        <FeaturedToday />
        <BrowsePage />
      </div>
    );
  }

}

export default Home;
